import React from 'react';
import './Banner.css'

export function Banner() {
    return (
        <section className=''>
            <div id="banner">
                <div className="banner">
                    <img src="Minibanner.jpg" alt=""/>
                </div>
                <div className="banner">
                    <img src="Minibanner1.jpg" alt=""/> 
                </div>
            </div>
        </section>
    )
}
